import React from 'react';
import './Row.css';
const Row = ({left, right}) => {
   return (
     <div className="">
       <div className="d-flex left">
         {left}
       </div>
       <div className="d-flex right">
         {right}
       </div>
     </div>
   );
 };
 export default Row;
